import React from 'react';
import './Note.css';

function Note({ note, deleteNote }) {
  return (
    <div className="note">
      <div className="content">
        <p>{note.text}</p>
      </div>
      <div className="footer">
        <p className="date">{note.createdAt}</p>
        <button className="delete-button" onClick={() => deleteNote(note.id)}>Delete</button>
      </div>
    </div>
  );
}

export default Note;
